const imageSourceMap: {[key: string]: Frame} = {};

for (const imagePack of imagePacks) {
    for (const packedImage of imagePack.packedImages) {
        // The parent frame string is always the first listed frame string.
        const [x,y,w,h] = packedImage.frameStrings[0].split(',').map(s => Number(s));
        const parentFrame = {x, y, w, h};
        for (const childFrameString of packedImage.frameStrings) {
            const [x,y,w,h] = childFrameString.split(',').map(s => Number(s));
            const childFrame = {x, y, w, h};
            imageSourceMap[packedImage.originalSource + ':' + childFrameString] = {
                image: imagePack.image,
                x: packedImage.x + childFrame.x - parentFrame.x,
                y: packedImage.y + childFrame.y - parentFrame.y,
                w: childFrame.w,
                h: childFrame.h,
                originalSource: packedImage.originalSource,
            };
            //if (childFrameString !== packedImage.frameStrings[0]) {
            //    console.log(packedImage.frameStrings[0], childFrameString, imageSourceMap[packedImage.originalSource + ':' + childFrameString]);
            //}
        }
    }
}

export const framesBySource: {[key in string]: Set<string>} = {};
window.framesBySource = framesBySource;
export function requireFrame(source: string, r: FrameRectangle, callback?: (frame: Frame) => void): Frame {
    const frameString = `${r.x},${r.y},${r.w},${r.h}`;
    const fullSource = `${source}:${frameString}`;
    const packedFrame = imageSourceMap[fullSource];
    if (packedFrame) {
        const frame = {
            ...r,
            ...packedFrame,
        };
        if (callback) {
            allImagesLoaded().then(() => callback(frame));
        }
        return frame;
    }
    // console.log('Missing packed frame', fullSource);
    framesBySource[source] = framesBySource[source] ?? new Set();
    framesBySource[source].add(frameString);
    const frame = {
        image: requireImage(source),
        originalSource: source,
        ...r,
    };
    if (callback) {
        allImagesLoaded().then(() => callback(frame));
    }
    return frame;
}

export function getPackedImage(name: string): PackedImageData {
    // Use includes here since the source also has the `?v=...` version string appended to it.
    const data = imagePacks.find(pack => pack.image.src.includes(name + ".png"));
    if (!data) {
        throw new Error('Unable to find packaged image: ' + name);
    }
    return data;
}
